module.exports = "<div class=\"privacy_policy_wrapper\">\n  <div class=\"policy_block\">\n    <p><b>This Privacy Policy applies to the www.munchpak.in</b></p>\n    <p>www.munchpak.in recognises the importance of maintaining your privacy. We value your privacy and appreciate your trust in us. This Policy describes how we treat user information we collect on https://www.munchpak.in and other offline sources. This Privacy Policy applies to current and former visitors to our website and to our online customers. By visiting and/or using our website, you agree to this Privacy Policy.</p>\n    <p>munchpak.in is a property of AMedes Foods Private Limited (OPC), an Indian Company registered under the Companies Act, 2013 having its registered office at Top floor, Simhadri Mansion, Ramkrishnappa Road, Cox Town, Bengaluru 560005</p>\n  </div>\n  <div class=\"policy_block\">\n    <p><b>Information we collect</b></p>\n    <p><b>Contact information. </b> We might collect your name, email, mobile number, phone number, street, city, state, pincode,  country and ip address.</p>\n    <p><b>Payment and billing information. </b>We might collect your billing name, billing address and payment method when you buy our products. We NEVER collect your credit card number or credit card expiry date or other details pertaining to your credit card on our website. Credit card information will be obtained and processed by our online payment partner BankOpen.</p>\n    <p><b>Information you post. </b>We collect information you post in a public space on our website or on a third-party social media site belonging to munchpak.in.</p>\n    <p><b>Demographic information. </b>We may collect demographic information about you, events you like, events you intend to participate in, tickets you buy, or any other information provided by your during the use of our website. We might collect this as a part of a survey also.</p>\n    <p><b>Other information. </b>If you use our website, we may collect information about your IP address and the browser you're using. We might look at what site you came from, duration of time spent on our website, pages accessed or what site you visit when you leave us. We might also collect the type of mobile device you are using, or the version of the operating system your computer or device is running. </p>\n    <p><b>We collect information in different ways.</b></p>\n    <p><b>We collect information directly from you. </b>We collect information directly from you when you buy products from us. We also collect information if you post a comment on our websites or ask us a question through phone or email.</p>\n    <p><b>We collect information from you passively. </b>We use tracking tools like Google Analytics, browser cookies and web beacons for collecting information about your usage of our website. </p>\n    <p><b>We get information about you from third parties. </b>For example, if you use an integrated social media feature on our websites. The third-party social media site will give us certain information about you. This could include your name and email address.</p>\n  </div>\n  <div class=\"policy_block\">\n    <p><b>Use of your personal information</b></p>\n    <p><b>We use information to contact you: </b> We might use the information you provide to contact you for confirmation of a purchase on our website or for other promotional purposes.</p>\n    <p><b>We use information to respond to your requests or questions. </b>We might use your information to confirm your order by sending you an email or message.</p>\n    <p><b>We use information to improve our products and services.  </b>We might use your information to customize your experience with us. This could include displaying content based upon your preferences.</p>\n    <p><b>We use information to look at site trends and customer interests. </b>We may use your information to make our website and products better. We may combine information we get from you with information about you we get from third parties.</p>\n    <p><b>We use information for security purposes. </b>We may use information to protect our company, our customers, or our websites.</p>\n    <p><b>We use information for marketing purposes. </b>We might send you information about special promotions or offers. We might also tell you about new features or products. These might be our own offers or products, or third-party offers or products we think you might find interesting. Or, for example, if you buy our product from us we'll enroll you in our newsletter. </p>\n    <p><b>We use information to send you transactional communications. </b>We might send you emails or SMS about your account or a ticket purchase. </p>\n    <p>We use information as otherwise permitted by law.</p>\n  </div>\n  <div class=\"policy_block\">\n    <p><b>Sharing of information with third-parties</b></p>\n    <p><b>We will share information with third parties who perform services on our behalf. </b>We share information with vendors who help us manage our online registration process or payment processors or transactional message processors. Some vendors may be located outside of India.</p>\n    <p><b>We will share information with the event organizers. </b>We share your information with event organizers and other parties responsible for fulfilling the purchase obligation. The event organizers and other parties may use the information we give them as described in their privacy policies. </p>\n    <p><b>We will share information with our business partners. </b>This includes a third party who provide or sponsor an event, or who operates a venue where we hold events. Our partners use the information we give them as described in their privacy policies. </p>\n    <p><b>We may share information if we think we have to in order to comply with the law or to protect ourselves. </b>We will share information to respond to a court order or subpoena. We may also share it if a government agency or investigatory body requests. Or, we might also share information when we are investigating potential fraud. </p>\n    <p><b>We may share information with any successor to all or part of our business. </b>For example, if part of our business is sold we may give our customer list as part of that transaction.</p>\n    <p><b>We may share your information for reasons not described in this policy. </b>We will tell you before we do this.</p>\n    <p><b>Email Opt-Out</b></p>\n    <p><b>You can opt out of receiving our marketing emails. </b>To stop receiving our promotional emails, please email bridgethegap@munchpak.in. It may take about ten days to process your request. Even if you opt out of getting marketing messages, we will still be sending you transactional messages through email and SMS about your purchases. </p>\n  </div>\n  <div class=\"policy_block\">\n    <p><b>Third party sites </b></p>\n    <p>If you click on one of the links to third party websites, you may be taken to websites we do not control. This policy does not apply to the privacy practices of those websites. Read the privacy policy of other websites carefully. We are not responsible for these third party sites.</p>\n  </div>\n  <div class=\"policy_block\">\n    <p><b>Grievance Officer</b></p>\n    <p>In accordance with Information Technology Act 2000 and rules made there under, the name and contact details of the Grievance Officer are provided below:</p>\n    <address>\n        Nivedita R.<br> \n        Top floor, Simhardri Mansion<br>\n        Ramkrishnappa road, <br>\n        Cox Town, Bengaluru<br>\n        560005\n    </address>\n  </div>\n  <div class=\"policy_block\">\n    <p>If you have any questions about this Policy or other privacy concerns, you can also email us at <a href=\"mailto:bridgethegap@munchpak.in\">bridgethegap@munchpak.in</a></p>\n  </div>\n  <div class=\"policy_block\">\n    <p><b>Updates to this policy</b></p>\n    <p>This Privacy Policy was last updated on 09.11.18. From time to time we may change our privacy practices. We will notify you of any material changes to this policy as required by law. We will also post an updated copy on our website. Please check our site periodically for updates.</p>\n  </div>\n  <div class=\"policy_block\">\n    <p><b>Jurisdiction</b></p>\n    <p>If you choose to visit the website, your visit and any dispute over privacy is subject to this Policy and the website's terms of use. In addition to the foregoing, any disputes arising under this Policy shall be governed by the laws of India.</p>\n  </div>\n</div>"

